import {IibToken} from "./interfaces/IibToken.sol";
import {ILendingPool} from "./interfaces/ILendingPool.sol";
import {SafeERC20} from "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";

contract ibToken is IibToken, Ownable {
    using SafeERC20 for IERC20;
    string private _name;
    string private _symbol;
    address _pool;
    address public override UNDERLYING_ASSET_ADDRESS;

    uint256 public override totalSupply;
    mapping(address => uint256) public override balanceOf;
    mapping(address => mapping(address => uint256)) public override allowance;

    constructor(
        string memory name_,
        string memory symbol_,
        address underlyingAsset
    ) {
        _name = name_;
        _symbol = symbol_;
        UNDERLYING_ASSET_ADDRESS = underlyingAsset;
    }

    modifier onlyLendingPool() {
        require(msg.sender == address(_pool), "Not called by lending pool");
        _;
    }

    function setLendingPool(address pool_) external onlyOwner {
        _pool = pool_;
    }

    function transfer(address to, uint256 amount) external returns (bool) {
        // TODO validate the aTokens between two users. Validate the transfer
        // TODO if health factor is still good after the transfer, it's allowed to transfer
    }

    function approve(
        address owner,
        address spender,
        uint256 amount
    ) external returns (bool) {
        // TODO
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        allowance[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) external returns (bool) {}

    function mint(
        address user,
        uint256 amount,
        uint256 index
    ) external onlyLendingPool returns (bool) {}

    function burn(
        address user,
        address receiverOfUnderlying,
        uint256 amount,
        uint256 index
    ) external onlyLendingPool {}

    function transferOnLiquidation(
        address from,
        address to,
        uint256 value
    ) external override {}

    function transferUnderlyingTo(address user, uint256 amount)
        external
        override
        returns (uint256)
    {}

    function handleRepayment(address user, uint256 amount) external override {}

    function approve(address spender, uint256 amount)
        external
        override
        returns (bool)
    {}
}
